import { Redirect } from "react-router-dom"

const Dialogs = (props) => {
  if (props.isAuth==false) return <Redirect to={"/login"} />
  return (
    <>
      {props.isAuth? "exit":"login"}
    </>
  )
}

export default Dialogs
